const restCfWorker = require('cloudflare-worker-rest-api');
const pako = require('pako');
const app = new restCfWorker();

app.post("/pob", async (req, res) =>
{
    body = await req.body()
    query = req.query()

    var strPBContent = body.pbcontent;
    var strDecoded = pako.inflate(atob(strPBContent.replace(/_/g, '/').replace(/-/g, '+')),
    {
        to: 'string'
    });

    return new Response(strDecoded,
    {
        status: 200,
        headers:
        {
            "content-type": "text/xml"
        }
    })
})

app.post("/uniques", async (req, res) =>
{
    body = await req.body()
    query = req.query()

    var strPBContent = body.pbcontent;
    var strDecoded = pako.inflate(atob(strPBContent.replace(/_/g, '/').replace(/-/g, '+')),
    {
        to: 'string'
    });
    let arrDecoded
    let objError

    try
    {
        const regex = /(?<=Rarity: UNIQUE\n)(.*?)(?=\n)/gsu;
        arrDecoded = strDecoded.match(regex);
        arrDecoded.forEach(function(part, index)
        {
            this[index] = this[index].replace(/&apos;/g, "'");
        }, arrDecoded);
    }
    catch (e)
    {
        objError = e
    }

    return res.send(
    {
        err: objError,
        arrDecoded: arrDecoded
    })
})

app.post("/cluster", async (req, res) =>
{
    body = await req.body()
    query = req.query()

    var strPBContent = body.pbcontent;
    var strDecoded = pako.inflate(atob(strPBContent.replace(/_/g, '/').replace(/-/g, '+')),
    {
        to: 'string'
    });
    let arrDecoded
    let objError

    try
    {
        const regex = /(?<=<Item id=&quot;([0-9]+)&quot;>  Rarity: )(.*?)(?=  <\/Item>)/gsu;
        arrDecoded = strDecoded.match(regex);
        arrDecoded.forEach(function(part, index)
        {
            this[index] = this[index].replace(/&apos;/g, "'");
        }, arrDecoded);
    }
    catch (e)
    {
        objError = e
    }

    return res.send(
    {
        err: objError,
        arrDecoded: arrDecoded
    })
})

